I'm building a Twitter agent and have configured the character file as follows:
```
settings: {
    "voice": {
        "model": "en_US-male-medium"
    },
    ragKnowledge: true
},
plugins: [],
knowledge: [
    {
        path: "/{mr.agent}/docs.pdf",
        shared: false
    }
],
```
I've set up the above configuration to enable the RAG knowledge base for the agent.

The provided knowledge document is being processed (I can see logs), but it seems that retrieval isn't working—the agent isn't responding based on the provided knowledge. (The PDF is only 5 pages long.)

Am I missing any additional configurations? Is there anything that needs to be set up in AgentRunTime?

Any insights would be appreciated!

Is there any working example of knowledge based agent?
